import React from 'react';

function App(){
  return(
    <div>
      <div className="card">
        <div className="card-header">Body Mass Index</div>
        <div className="card-body">
          <h5 className="card-title">Title</h5>
          <p className="card-text">content</p>
        </div>
        <div className="card-footer">test</div>
      </div>
    </div>
  );
}

export default App;
